import React, { Component } from 'react';
import './index.css';
import Pic from './frontimg.jpg';

class Dashboard extends Component {
  render() {
    return (
      <div className="box">
      <img className='pic' src={Pic} alt='frontpic' />
      <User />
      </div>
    );
  }
}

export default Dashboard;
